import React from 'react';
import '../../App.css';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/Container';

export default function Gisindex() {
  return (
    <>

      <th  colSpan="4" style={{background: "#FBDDD1" ,width: "70%", textAlign: "center",padding: "8px",fontSize: "14px!important" }}>Summary of GIS Based Applications received on e-service "NOC in respect of Block Forest " </th>
      <Container>
        <Row>
        <Col style={{backgroundColor:"#37a0dd"}} xs={1}> <b>Legends</b></Col> 
        <Col style={{backgroundColor:"#ccc"}} xs={1}><b>Total</b></Col> 
        <Col style={{backgroundColor:"#43b270"}} xs={2}><b>Within Time</b></Col> 
        <Col style={{backgroundColor:"#f2842b"}} xs={2}><b>Beyond Time</b></Col> 
        </Row>
      </Container>
    </>
  );
}
